import React from 'react'
import {
  BrowserRouter as Router, 
  Route
} from 'react-router-dom'
import Layout from './layout/Layout'
import Home from './components/pages/Home'

import './App.css';

function App() {
  return (
    <div>
      <Router>
        <Layout>

            <Route path={'/'} component={Home}></Route>

        </Layout>
      </Router>
    </div>
  );
}

export default App;
